import axios from 'axios';
import React, { useState } from 'react'
import { useNavigate } from 'react-router-dom';

const ShtoKategori = () => {
        
      const [product, setProduct] = useState({
        name: '',
        description: ''
      })
    
      const navigate = useNavigate()
    
      const handleSubmit = (event) => {
        event.preventDefault();
        const formData = new FormData();  
        formData.append("name", product.name);
        formData.append("description", product.description);
        axios.post('http://localhost:8081/createCategory', formData)
          .then(res => {
            navigate('/kategorite')
          })
          .catch(err => console.log(err))
      }
    
      return (
        <div className='d-flex flex-column align-items-center pt-4'>
          <h2>Create Category</h2>
          <form class="row g-3 w-50" onSubmit={handleSubmit}>
            <div class="col-12">
              <label for="inputName" class="form-label">Name</label>
              <input type="text" class="form-control" id="inputName" placeholder='Enter Name' autoComplete='off'
                onChange={e => setProduct({ ...product, name: e.target.value })} />
            </div>
            <div class="col-12">
              <label for="inputDescription" class="form-label">Description</label>
              <textarea class="form-control" id="inputDescription" rows="3" placeholder='Enter Description'
                onChange={e => setProduct({ ...product, description: e.target.value })}></textarea>
            </div>
            <div class="col-12">
              <button type="submit" class="btn btn-primary">Create</button>
            </div>
          </form>
        </div>
      )
    }

export default ShtoKategori
